<!DOCTYPE HTML>
<html>
<head>
<meta http-equiv="Content-Type" content="text/html; charset=utf-8">
<title>QUnit Test Suite</title>
<link rel="stylesheet" media="screen" href="../qunit/qunit.css" />
</head>

<body>
<h1 id="qunit-header">QUnit Test Suite</h1>
<h2 id="qunit-banner"></h2>
<div id="qunit-testrunner-toolbar"></div>
<h2 id="qunit-userAgent"></h2>
<ol id="qunit-tests"></ol>

<script type="text/javascript">
var root = this;
var ___prev_module = window.module;
window.module = {};
</script>
<script type="text/javascript" src="../../config.js"></script>
<script type="text/javascript">
var ___opts = module.exports;
</script>
<script type="text/javascript">
(___opts.external || []).forEach(function(file){
	document.write("\n" + '<scr' + 'ipt type="text/javascript" src="../../vendor/' + file + '"></scr' + 'ipt>');
});
</script>
<script type="text/javascript">
window.module = ___prev_module;
___opts.src.forEach(function(file){
	document.write("\n" + '<scr' + 'ipt type="text/javascript" src="../../coverage/' + file + '"></scr' + 'ipt>');
});
</script>
<script type="text/javascript" src="../qunit/qunit.js"></script>
<script type="text/javascript" src="coverage-phantom-hooks.js"></script>
<script type="text/javascript">
___opts.unit.forEach(function(file){
	document.write("\n" + '<scr' + 'ipt type="text/javascript" src="../../test/' + file + '"></scr' + 'ipt>');
});
</script>
</body>
</html>
